// src/Pages/Page5.js
import React, {useEffect} from 'react';
import { Link } from 'react-router-dom';
import './Page5.css';

const Page5 = () => {

  useEffect(() => {
    window.scrollTo(0, 0); // Scroll to the top on page load
  }, []);
 
  return (
    <div className="page5-container">
    {/* Header Section */}
    <header className="header">
      <h1 className="header-title">Our Cherished Memories</h1>
      <p className="header-subtitle">A journey through love, laughter, and unforgettable moments</p>
    </header>

    {/* Video Section */}
    <section className="video-section">
      <h2>Our Special Moments</h2>
      <div className="video-container">
        <video controls>
          <source src="/assets/Video1.mp4" type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </div>
    </section>

    {/* Quote Section */}
    <section className="quote-section">
      <h3>Our Favorite Quotes</h3>
      <blockquote>
        "Love is not about how many days, months, or years you have been together. Love is about how much you love each other every single day."
      </blockquote>
    </section>

    {/* Memory Map Section */}
    <section className="memory-map">
      <h3>Significant Places</h3>
      <div className="map-container">
        {/* Embed Google Maps iframe or use an interactive map library */}
        <iframe
          width="600"
          height="450"
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3153.115136092306!2d-122.08385138468112!3d37.38605130911274!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x808fb5a32564d07b%3A0xa52b1d5c62db3473!2sGoogleplex!5e0!3m2!1sen!2sus!4v1579303957217!5m2!1sen!2sus"
          frameBorder="0"
          allowFullScreen=""
          aria-hidden="false"
          tabIndex="0"
        ></iframe>
      </div>
    </section>

    {/* Footer */}
    <footer className="footer">
      <p className="footer-text">Created with love, by us ðŸ’–</p>
    </footer>
  </div>
);
}
  
 export default Page5;
